// QR code detection using jsQR library
const detectQRCode = async (imageData) => {
  try {
    // Use jsQR to detect QR code
    const code = window.jsQR(
      imageData.data,
      imageData.width,
      imageData.height
    );

    if (code) {
      return code.data;
    }
  } catch (error) {
    console.error('QR detection error:', error);
  }
  return null;
};

export { detectQRCode };
